import React from 'react';

function UserFollowers({ setUsername }) {
  // Use setUsername wherever needed
  return (
    <div>
      {/* Example usage of setUsername */}
      <button onClick={() => setUsername('newUsername')}>
        Set Username
      </button>
    </div>
  );
}

export default UserFollowers;
